import math

def find_closest_phase_pair(angle, antenna1_phases, antenna2_phases):
    min_difference = float('inf')
    closest_pair = None

    for phase1 in antenna1_phases:
        for phase2 in antenna2_phases:
            phase_difference = abs(phase1 - phase2 - angle)
            if phase_difference < min_difference:
                min_difference = phase_difference
                closest_pair = (phase1, phase2)

    return closest_pair

